import React, {Component} from "react"
import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
import Header from "./component/Header.jsx"
import Footer from "./component/Footer.jsx"
//import Login from "../pages/login/Login"
//import Error from "../pages/error/Error"
//import HomePage from "../pages/home_page/HomePage.jsx"
//import Registration from "../pages/registration/Registration.jsx"
//import SearchMatch from "../pages/search_match/SearchMatch.jsx"
import AuthenticatedRoute from "./component/AuthenticatedRoute.jsx"
//import Profile from "../pages/profile/Profile.jsx"
//import ShowFriends from "../pages/show_friends/ShowFriends.jsx"
import UserInfoUpdate from "../pages/user_Info_update/UserInfoUpdate" 

import { Error, HomePage, Login, Profile, Registration, SearchMatch, ShowFriends} from '@pages/index.js'

class Routes extends Component {
    render(){
               
        return(
           
            <div className="MyApp">

                <Router>

                    <>

                        <Header/>

                        <Switch>
                            <AuthenticatedRoute path="/search/match/" component={SearchMatch}/> 
                            <AuthenticatedRoute path="/profile/settings/update" component={UserInfoUpdate}/> 
                            <Route path="/registration/" component={Registration}/>
                            <Route path="/login/" component={Login}/>
                            <AuthenticatedRoute path="/profile/friends/show/" component={ShowFriends}/>
                            <AuthenticatedRoute path="/profile/" component={Profile}/>
                            <Route path="/" exact component={HomePage}/>
                            <Route component={Error}/>
                        </Switch>

                    </>

                        <Footer/>

                </Router>

            </div>
        )
    }
}

export default Routes
